import React from "react";

function Profile() {
  return (
    <div>
      <div className="nav-pro">
        <h3>User Profile</h3>
        <ul className="nav-links">
          <Link to="/">
            <li>Home</li>
          </Link>
          <li>Notifications</li>
          <Link to="/profile">
            <li>Profile</li>
          </Link>
        </ul>
      </div>
      <h1> Profile Page</h1>
    </div>
  );
}

export default Profile;
